import './SocialButton.scss';


function SocialButton({className, imgSrc, text}) {

    return (
        <button className={`${className} isfriend`}>
            <img className="social__button-icon" img={imgSrc} alt="social"/>
            <span className="social__button-text">{text}</span>
        </button>
    )
}

export default SocialButton;
